import React from "react";

function Resume() {
    return (

        <section id="resume">
        <h2>Resume</h2>
        <div className="resumeStyle">
          <h4><a href="./assets/images/ResumeThang.pdf" target="_blank">Download Resume</a></h4>
        </div>

      </section>
    );
}

export default Resume;
